import styled from 'styled-components';
import DashboardHome from './DashboardHome';
const Container = styled.div``
const Wrapper = styled.div``

const Dashboard = () => {
  return (
    <Container>
        <Wrapper>
            <DashboardHome/>
        </Wrapper>
    </Container>
  )
}

export default Dashboard
